# python imports
import time

# local imports
import search.search_dna as search_dna


def test_find_overlap():
    """ Confirm that we successfully find the correct number if overlapping"""

    result, source = search_dna.search_reference('AAAAA', 'AAA')
    assert(result[0] == 3)

    # Think of better way to compare lists?
    assert(result[1]['target'] == [0,1,2])
    assert(result[1]['rc'] == [])

    print('Test find overlap passed')


def test_first_example():
    """ Reference genome GATATC and Target genome ATC 

    Expected Result: 2 matches, at the 0th and 3rd indexes
    """	

    result, source = search_dna.search_reference('GATATC', 'ATC')
    assert(result[0] == 2)

    # Think of better way to compare lists?
    assert(result[1]['target'] == [3])
    assert(result[1]['rc'] == [0])

    print('Test 1 passed')


def test_second_example():
    """ Reference genome ATCCT and Target genome ATC

    Expected Results: 1 match, at the 0th index.
    """

    result, source = search_dna.search_reference('ATCCT', 'ATC')
    assert(result[0] == 1)

    # Think of better way to compare lists?
    assert(result[1]['target'] == [0])
    assert(result[1]['rc'] == [])

    print('Test 2 passed')


def test_third_example():
    """ Reference genome CATATGGGCAT and Target genome CAT 

    Expected Results: 3 matches, at the 0th, 3rd, 8th indexes
    """

    result, source = search_dna.search_reference('CATATGGGCAT', 'CAT')
    assert(result[0] == 3)

    # Think of better way to compare lists?
    assert(result[1]['target'] == [0,8])
    assert(result[1]['rc'] == [3])
    assert(source == 'calc')

    print('Test 3 passed')

def test_fourth_example():
    """ Reference genome ACTACTACT and Target genome ACTACT 

    Expected Results: 2 matches, at the 0th, and 3rd indexes
    """

    result, source = search_dna.search_reference('ACTACTACT', 'ACTACT')
    assert(result[0] == 2)

    # Think of better way to compare lists?
    assert(result[1]['target'] == [0,3])
    assert(result[1]['rc'] == [])

    print('Test 4 passed')


def test_valid_error():
    """ Check for valid error message"""
    try:
        result, source = search_dna.search_reference('GaTATC', 'ATC')
    except search_dna.BadDnaString as bx:
        assert(str(bx).startswith("Invalid reference DNA string"))

    print('Test valid error passed')


def test_use_data_store():
    """ Validate use of datastore"""
    result, source = search_dna.search_reference('GATATC', 'ATC')
    
    # Verify that result, when requested again, comes from datastore.
    result, source = search_dna.search_reference('GATATC', 'ATC')
    assert(source == 'db')
    
    print('Test use data-store passed')


def test_timing():

    import timeit
    ref = ''
    ref += ref + ref + ref
    tar = 'CATAAGCTAGCC'
    tar = tar + tar + tar
    setup_ = "import search.search_dna as search_dna"
    stmt_ = "search_dna.search_reference('{}', '{}', cache=False)".format(ref, tar)

    number_ = 4000
    run_time = timeit.timeit(stmt_, setup_, number=number_)

    m = len(ref)
    n = len(tar)

    print('')
    print('Run time for reference length m={}, and target length n={} and #runs={} is: {}'.format(m, n, number_, run_time))
    # For window, may need this to see all output.

    assert(run_time < 50)  # seconds    

    print("timing test passed")


if __name__ == "__main__":
    test_find_overlap()
    test_first_example()
    test_second_example()
    test_third_example()
    test_fourth_example()
    test_valid_error()
    test_use_data_store()
    test_timing()


